window.bookSummaryJSON = "<p>Purgatory is mine. I'll do whatever it takes to ensure humanity finds the balance it deserves. With the seven sinners and the most notorious devil by my side, we can change the world. No, not only the world. The entire universe. We have to. Our futures depend on it. The angelic army plans to reset everything, bringing on the End of Times.<br> <br> I refuse to let such a thing happen. I didn't lose my soul for nothing. Heaven's lost angels won't be able to keep their power for long. They've never met an angel-kissed and devil-loved mortal with a new purpose in life. I have too much to lose. So does humanity.<br> <br> Hell will rise to its intended glory. And with it, so will I.<br> <br> Enter Hell's Kingdom and ride the devils down in this thrilling, unforgettable finale.</p>"; 
